import {AppBar, Button, IconButton, Menu, MenuItem, Typography} from "@material-ui/core";
import Toolbar from "@material-ui/core/Toolbar";
import React from "react";
import {makeStyles} from "@material-ui/core/styles";
import MenuIcon from '@material-ui/icons/Menu';
import {Link, NavLink} from "react-router-dom";

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },
}));

export default function NavBar() {
    const classes = useStyles();
    // const [anchorEl, setAnchorEl] = React.useState(null);

    // const handleClick = (event) => {
    //   setAnchorEl(event.currentTarget);
    // };

    return (
        <AppBar position="static">
            <Toolbar>
                <Button component={Link} to="/about" color="inherit"> About Me </Button>
                <Button component={Link} to="/linkedin" color="inherit"> LinkedIn </Button>
                <Button component={Link} to="/projects" color="inherit"> Projects </Button>
                <Button component={Link} to="/contact" color="inherit"> Contact </Button>
                <Button component={Link} to="/resume" color="inherit"> Resume </Button>
            </Toolbar>
        </AppBar>
    );
}
